  const finalInfo = useSelector(cart=>cart.cart);
  console.log(new Date('dd/mm/yyyy'));
  const finalInfoMap = {
    idOrder: "#100000326",
    orderDate: '',
    payMethod: finalInfo.title,
    listProduct: finalInfo.cartList,
    intoMoney: finalInfo.totalPay
  };

  return (
    <div className="ContainerCompletedOrder">
      <OrderDetail orderDetail={orderDetail} />
    </div>
  );
}

